import React from 'react';
import { Button, Form } from 'react-bootstrap';
import CommandForm from './CommandForm';
import CommandList from './CommandList';
import Board from './ShipAndGrid';


const Home = () => {

  return (
    <div>
      <header>
       <h1>Explore</h1>
       <h1>Mars</h1>
      </header>
      <CommandForm />

      <CommandList />
      <Board />
    </div>
  );
};

export default Home;
